/* Reset for consistency */
* { margin: 0; padding: 0; box-sizing: border-box; }
body { font-family: 'Arial', sans-serif; font-size: 16px; }

/* Test container */
.test-container {
    width: 800px;
    height: 900px;
    border: 2px solid #333;
    padding: 20px;
    background-color: #f9f9f9;
}

/* Test-specific CSS */
.overflow-test {
    margin: 20px 0;
    padding: 15px;
    border: 1px dashed #999;
    background-color: white;
}

.test-title {
    font-weight: bold;
    margin-bottom: 10px;
    color: #333;
}

.overflow-box {
    width: 200px;
    height: 100px;
    border: 2px solid #666;
    background-color: #f0f0f0;
    padding: 10px;
    margin: 10px;
    display: inline-block;
    vertical-align: top;
}

.content {
    background-color: #ffcccc;
    padding: 5px;
    border: 1px solid #999;
}

.long-content {
    width: 300px;
    height: 150px;
    background-color: #ccffcc;
    border: 1px solid #666;
    padding: 10px;
}

/* Overflow behaviors */
.overflow-visible {
    overflow: visible;
    background-color: #ffffcc;
}

.overflow-hidden {
    overflow: hidden;
    background-color: #ffccff;
}

.overflow-scroll {
    overflow: scroll;
    background-color: #ccffff;
}

.overflow-auto {
    overflow: auto;
    background-color: #ccccff;
}

/* Individual axis overflow */
.overflow-x-scroll {
    overflow-x: scroll;
    overflow-y: hidden;
    background-color: #ffccaa;
}

.overflow-y-scroll {
    overflow-x: hidden;
    overflow-y: scroll;
    background-color: #ccffaa;
}

/* Text overflow */
.text-overflow-test {
    width: 150px;
    height: 30px;
    border: 1px solid #666;
    background-color: white;
    padding: 5px;
    margin: 5px;
    display: inline-block;
    line-height: 20px;
}

.text-ellipsis {
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
    background-color: #ffeecc;
}

.text-clip {
    white-space: nowrap;
    overflow: hidden;
    text-overflow: clip;
    background-color: #eeffcc;
}
